import React from 'react';
import { Link } from 'react-router-dom';
import '../../CSS/ViewerManagement.css';

const ViewerManagement = () => {
  // Handle your viewer management logic here
  return (
    <div>
      <h2>Manage Viewers</h2>
      {/* Your viewer management buttons */}
      <Link to="/admin/viewers">View Viewers</Link>
      {/* Add more buttons for adding/removing viewers */}
    </div>
  );
};

export default ViewerManagement;
